import React from 'react';

function Levels() {
    for (var i=0; i<100; i++) {
        var newButton = document.createElement("button");
        newButton.setAttribute("type", "button");
        newButton.innerHTML = i;
        document.getElementById("levels").appendChild(newButton);
    }
    return(
        <div id="levels">
            
        </div>
    )
}

export default Levels;
